-- Задание 6.2
-- Создать все необходимые внешние ключи и диаграмму отношений.
ALTER TABLE profiles
  ADD CONSTRAINT profiles_user_id_fk 
    FOREIGN KEY (user_id) REFERENCES users(id)
      ON DELETE CASCADE;

ALTER TABLE messages
  ADD CONSTRAINT messages_from_user_id_fk 
    FOREIGN KEY (from_user_id) REFERENCES users(id),
  ADD CONSTRAINT messages_to_user_id_fk 
    FOREIGN KEY (to_user_id) REFERENCES users(id);

ALTER TABLE friendship 
  ADD CONSTRAINT friendship_user_id_fk 
    FOREIGN KEY (user_id) REFERENCES users(id),
  ADD CONSTRAINT friendship_friend_id_fk 
    FOREIGN KEY (friend_id) REFERENCES users(id),
  ADD CONSTRAINT friendship_friendship_status_id_fk 
    FOREIGN KEY (friendship_status_id) REFERENCES friendship_statuses(id);

ALTER TABLE communities_users
  ADD CONSTRAINT communities_users_community_id_fk 
    FOREIGN KEY (community_id) REFERENCES communities(id),
  ADD CONSTRAINT communities_users_user_id_fk 
    FOREIGN KEY (user_id) REFERENCES users(id);

 ALTER TABLE media
  ADD CONSTRAINT media_user_id_fk 
    FOREIGN KEY (user_id) REFERENCES users(id),
  ADD CONSTRAINT media_media_type_id_fk 
    FOREIGN KEY (media_type_id) REFERENCES media_types(id);

ALTER TABLE posts
  ADD CONSTRAINT posts_user_id_fk 
    FOREIGN KEY (user_id) REFERENCES users(id),
  ADD CONSTRAINT posts_community_id_fk 
    FOREIGN KEY (community_id) REFERENCES communities(id),
  ADD CONSTRAINT posts_media_id_fk 
    FOREIGN KEY (media_id) REFERENCES media(id);
   
ALTER TABLE likes
  ADD CONSTRAINT likes_user_id_fk 
    FOREIGN KEY (user_id) REFERENCES users(id);

   
   
-- Задание 6.3  
-- Определить кто больше поставил лайков (всего) - мужчины или женщины?
SELECT 
	(SELECT IF(gender='M', 'Мужчины', 'Женщины') FROM profiles WHERE likes.user_id = profiles.user_id) AS genders,
	COUNT(*) AS count_likes
FROM 
	likes
GROUP BY 
	genders
ORDER BY 
	count_likes DESC;
	


-- Задание 6.4
-- Вывести для каждого пользователя количество созданных сообщений, постов, загруженных медиафайлов и поставленных лайков.
SELECT 
	id,
	CONCAT(first_name, ' ', last_name) AS user,
	(SELECT COUNT(from_user_id) FROM messages WHERE users.id = messages.from_user_id) AS count_messages,
	(SELECT COUNT(user_id) FROM posts WHERE users.id = posts.user_id) AS count_posts,
	(SELECT COUNT(user_id) FROM media WHERE users.id = media.user_id) AS count_media,
	(SELECT COUNT(user_id) FROM likes WHERE users.id = likes.user_id) AS count_likes
FROM 
	users;



-- Задание 6.5
-- (по желанию) Подсчитать количество лайков которые получили 10 самых молодых пользователей.
SELECT 
	SUM(count_likes) AS sum_likes 
	FROM
		(SELECT 
			(SELECT birthday FROM profiles WHERE users.id = profiles.user_id) AS birthday,
			(SELECT COUNT(*) FROM likes WHERE users.id = likes.target_id AND likes.target_type = 'users') AS count_likes
		FROM users
		ORDER BY birthday DESC
		LIMIT 10) AS likes;








